import useData from "./hooks/useData";

function App() {
  const { data } = useData()
  return (
    <div className="App">
      {
        data.map((person,index) => {
          return (
            <section key={index}>
              <h1>{person.name}</h1>
              <p>{person.email}</p>
              <p>{ person.phone}</p>
            </section>
          )
        })
      }
    </div>
  );
}

export default App;
